  false,\n\t\"url\": null,\n\t\"notes\": \"This annual narrative report for Erie National
  Wildlife Refuge outlines activities and accomplishments during the 2002 calendar
  year. The report begins with an introduction to the Refuge. Weather conditions are
  summarized for the year. Habitat restoration and management projects are also covered;
  activities include wetland restoration, upland restoration, grazing/mowing/haying,
  farming, and fire management. Fish and wildlife management are discussed next with
  emphasis on bird banding. Coordination activities, such as cooperative organizations,
  are outlined. The resource protection section provides an update on law enforcement
  and permits. Information about public education and recreation is given including
  visitor services and outreach. Finally, general administration is discussed in the
  Refuge planning and administration section.\",\n\t\"license_title\": \"License Not
